PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `radio_stations` (
	`id` text PRIMARY KEY NOT NULL,
	`market` text NOT NULL,
	`call_sign` text NOT NULL,
	`format` text,
	`city` text,
	`state` text
);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX `radio_stations_call_sign_unique` ON `radio_stations` (`call_sign`);
CREATE UNIQUE INDEX `call_sign_idx` ON `radio_stations` (`call_sign`);
COMMIT;
